Verenigde Staten
Horror
57 minuten

goed

met Brian Benben, Anthony Griffith en Cinthia Moura

Een aan lager wal geraakte politie agent mag zich slechts bezig houden met zaken die over (huis)dieren gaan. En beslist niet meer met moordzaken. Toeval treft dat een vrachtwagenchauffeur vermoord lijkt te zijn door een hert. Zijn collega's geloven niets van deze theorie, maar hij weet ze toch te overtuigen door de vergelijkbare Londense 'Wolfman' zaak uit 1981 aan te halen.:
